func (trs *TypeRoomSelect) sqlScan(ctx context.Context, v interface{}) error {
	rows := &sql.Rows{}
	query, args := trs.sqlQuery().Query()
	if err := trs.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}

func (trs *TypeRoomSelect) sqlQuery() sql.Querier {
	selector := trs.sql
	selector.Select(selector.Columns(trs.fields...)...)
	return selector
}
